import React from 'react';
import HomeBackground from "./HomeBackground"

function Home () {
    return (
			<section>
				<HomeBackground />
				<h1 className='sign-date'>Would you love to learn how to cook meth?</h1>
				<p>
					Well this is <strong>NOT</strong> the site for you.
				</p>
				<p>
					You will <strong>NOT</strong> learn how to cook meth here.
				</p>

				<h1 className='sign-date'>
					{' '}
					But you will find information about the show that made us all
					sympathize with a meth dealer.
				</h1>

				<h5 className='sign-date'>
					powered by Tim Biles' "The Breaking Bad API"
				</h5>
			</section>
		);
}

export default Home;
